INSERT INTO `party` VALUES ('ประชาธิปัตย์','001','IMG1','อภิสิทธิ์','เวชชาชีวะ','11-06-25','พรรคประชาธิปัตย์มุ่งขจัดความเหลื่อมล้ำทางเศรษฐกิจและสังคม ยกระดับรายได้เกษตรกร ส่งเสริมสังคมสวัสดิการและพัฒนาคุณภาพชีวิต พร้อมเร่งกระจายอำนาจและความเจริญไปทั่วประเทศ ยึดมั่นแนวทางประชาธิปไตยเสรี ต่อต้านเผด็จการทุกรูปแบบ ภายใต้แนวทาง “ประชาชนเป็นใหญ่ ประชาธิปไตยสุจริต” เพื่อบรรลุภารกิจ “แก้จน สร้างคน สร้างชาติ”'),('ประชากรไทย','002','IMG2','สุมิตร','สุนทรเวช','26-07-25','พรรคจะเทิดทูลระบอบประชาธิปไตยอันมีพระมหากษัตริย์ทรงเป็นประมุขให้อยู่คู่ประเทศไทยตลอดไป | พรรคจะเคารพกฎหมายรัฐธรรมนูญอันเป็นกฎหมายสูงสุดของประเทศ | พรรคจะรับใช้ประเทศชาติด้วยความซื่อสัตย์ สุจริต | พรรคจะใช้นวัตกรรมที่เกี่ยวกับปัญญาประดิษฐ์ เพื่อให้บังเกิดความก้าวหน้าทัดเทียมนานาประเทศ | พรรคจะกำจัดการทุจริตทุกรูปแบบ | พรรคจะยึดมั่นให้คนในชาติอยู่ร่วมกันอย่างสันติ สามัคคี ปรองดอง อยู่กันอย่างให้เกียรติบนหลักการและเหตุผล'),('มหาชน','004','IMG3','อภิรัต','ศิรินาวิน','10-02-41','“พร้อมชนเพื่อความเท่าเทียม” ความเสมอภาคต้องเกิดขึ้นทั้งด้านการเมือง เศรษฐกิจ และสังคม นโยบายที่จับต้องได้ ประกอบด้วย การผลักดันกฎหมายที่เกี่ยวข้องกับความเท่าเทียมทางเพศ ชาติพันธุ์ และสถานะทางสังคมที่ต่างกัน จัดให้มีการปรับเปลี่ยนทัศนคติยกเลิก “สังคมดัดจริต” เพื่อให้ปัญหาได้รับการแก้ไข การยกเลิก พรบ.ปราบปรามการค้าประเวณี ที่เป็นเพียงเครื่องมือในการรีดไถของเจ้าหน้าที่รัฐ การส่งเสริมเศรษฐกิจ SMEs Online ให้เข้าถึงทุกชุมชน และการริเริ่มนำรายได้เข้าประเทศด้วยการจัดให้มีคาสิโน (แบบมีเงื่อนไข) ขึ้นในเมืองไทย'),('กสิกรไทย','006','IMG4','จำลอง','ดำสิม','10-02-42','4 PLUS 2 (ประเทศไทยโฉมหน้าของเอเชีย THAILAND FACE OF ASIA | เศรษฐกิจไทยสมดุลนิยม THAILAND ECONOMIC BALANCE | ธนาคารข้าวไทย THAI RICE BANK | ธนาคารรีไซเคิล RECYCLE BANK | ศูนย์พัฒนาคุณภาพชีวิต NEW U NEW LIFE | มหาวิทยาลัยศาสตร์พระราชา UNIVERSITY OF SCIENCE KING)'),('เพื่อฟ้าดิน','010','IMG5','มิ่งหมาย','มุ่งมาจน','05-04-43','NULL'),('ความหวังใหม่','013','IMG6','ชิงชัย','มงคลธรรม','07-05-45','สร้างประชาธิปไตยให้เป็นจริงเหมาะสมกับชาติไทย สร้างพรรคให้เป็นของประชาชน สร้างคนให้เป็นประชาธิปไตย นำไทยให้พ้นทาส พัฒนาชาติด้วยเศรษฐกิจพอเพียง ฟื้นฟูอีสานเขียวภาค 2 เพิ่มพื้นที่ชลประทาน 33 ล้านไร่ ตั้งกระทรวงน้ำ เปลี่ยนเอกสารสิทธิที่ดินทั้งหมดเป็นโฉนด โครงการฮารับปันบารูใต้ร่มเย็น สร้างสันติสุขชาวภาคใต้ให้เป็นจริง ทบทวนสัญญาสัมปทานที่ไม่เป็นธรรม น้ำมันราคาถูก โทรศัพท์และอินเตอร์เน็ตฟรี ต่อต้านการคอรัปชั่นทุกๆด้าน แก้ไขปัญหาความยากจน ประกันราคาพืชผล ลดระยะเวลาเรียนทุกหลักสูตร สาธารณสุขรองรับผู้สูงอายุ (ปี) เด็กและสตรี เลือกพรรคความหวังใหม่ คือ ชัยชนะของประชาชน'),('เครือข่ายชาวนาแห่งประเทศไทย','022','IMG7','วชิร','ศุภรมย์','20-06-49','ยกระดับกองทุนฟื้นฟูและพัฒนาเกษตรกรให้ฟื้นฟูชีวิตและปลดหนี้ฯเกษตรกรได้อย่างแท้จริงตามกฎหมาย (กฟก.) | พัฒนากองทุนหมุนเวียนช่วยเหลือเกษตรกร (กชก.) ให้เป็นกฎหมายเพื่อฟื้นฟูชีวิตคนยากคนจนเกษตรกรและปลดหนี้นอกระบบตามกฎหมาย กชก. | ปฏิรูปกฎหมาย สปก. (สำนักงานปฏิรูปที่ดินเพื่อเกษตรกรรม) ให้จัดหาที่ทำกินให้คนจนและเกษตรกร | ออกกฎหมายเฉพาะเพื่อเก็บภาษีสินค้าทุนทางการเกษตร นำเงินมาให้ กฟก., กชก., สปก. เพื่อช่วยเหลือเกษตรกรและคนจน'),('เพื่อไทย','034','IMG8','วิโรจน์','เปาอินทร์','20-09-50','แก้ปัญหาเศรษฐกิจปากท้อง สร้างความเติบโตทางเศรษฐกิจ สร้างความเข้มแข็งให้เศรษฐกิจฐานราก ลงทุนในโครงสร้างพื้นฐานและระบบคมนาคมขนส่ง ระบบน้ำ สร้างรายได้จากการท่องเที่ยว การส่งออก การเกษตร SME และเศรษฐกิจดิจิทัล ให้ไทยเป็นศูนย์กลางผลิตอาหารปลอดภัย ของโลก ใช้เทคโนโลยีและนวัตกรรมเพื่อเพิ่มผลผลิตและเชื่อมตลาดโลก ยกระดับราคาสินค้าเกษตร ลดความเหลื่อมล้ำทางเศรษฐกิจและสังคม ส่งเสริมการเข้าถึงแหล่งทุน พัฒนาคน ยกระดับคุณภาพและลดความเหลื่อมล้ำทางการศึกษา พัฒนาระบบหลักประกันสุขภาพถ้วนหน้า กระจายอำนาจ ลดขนาดภาครัฐ ขจัดอุปสรรคในการประกอบธุรกิจด้วยการยกเลิกกฎหมายและใบอนุญาตที่ไม่จำเป็น ป้องกันและปราบปรามการทุจริตคอรัปชั่น แก้ปัญหายาเสพติด ดูแลผู้ใช้แรงงาน ผู้มีรายได้น้อย ผู้ด้อยโอกาส ผู้สูงอายุ เด็ก ผู้พิการ แก้รัฐธรรมนูญให้เป็นประชาธิปไตยและคุ้มครองสิทธิมนุษยชน'),('เพื่อแผ่นดิน','041','IMG9','พีระ','จันทร','02-10-50','ส่งเสริมการศึกษา การกีฬา และสุขภาวะ โดยสิบข้อดี ( กินดีอยู่ดี, กีฬาดี, การศึกษาดี, ครอบครัวดี, สังคมดี, สิ่งแวดล้อมดี, ราคาพืชผลดี)'),('พรรคชาติพัฒนา','045','IMG10','เทวัญ','ลิปตพัลลภ','03-10-50','พรรคชาติพัฒนามีนโยบายเร่งด่วนในการแก้ไขปัญหาเศรษฐกิจรากหญ้าให้กับเกษตรกรและคนในชนบท นำเทคโนโลยีที่ทันสมัยมาพัฒนาประเทศ ให้มีเศรษฐกิจที่มั่นคง สร้างนักธุรกิจรุ่นใหม่ สร้างSMEให้เข้มแข็ง พัฒนาระบบคมนาคมให้ทั่วถึงและปลอดภัย ส่งเสริมอุตสาหกรรมและการลงทุนมากขึ้น ส่งเสริมพลังงานทดแทน พัฒนาการท่องเที่ยวให้เป็นเศรษฐกิจหลัก สร้างความเสมอภาค ลดความเหลื่อมล้ำในสังคม เร่งรัดการกระจายอำนาจ สร้างสังคมผู้สูงอายุ (ปี) ให้มีสวัสดิการที่ดี ขยายอายุ (ปี) การทำงานถึง 65 ปี ดูแลคนพิการและผู้ด้อยโอกาส เพิ่มสวัสดิการแรงงานและการมีงานทำ กำจัดปัญหายาเสพติด จัดการปัญหาฝุ่นและดูแลสิ่งแวดล้อม เด็กไทยพูดได้ 2 ภาษา ใช้กีฬาสร้างคน สร้างชาติ สร้างความรักสามัคคี และยุติปัญหาขัดแย้ง'),('แทนคุณแผ่นดิน','053','IMG11','วิชัย','ศิรินคร','09-11-50','“แรงงานหน้าใส ใส่ใจคุณภาพชีวิต” โดย “สร้างคน สร้างอาชีพ สร้างรายได้”ประกอบด้วย ออม กู้ยืม ลงทุน สวัสดิการ “ปลดหนี้ ธนาคารแรงงาน” | มีบุตรครอบครัวละ 3 คน “ท้องปั๊บ รับสวัสดิการถึง ป.ตรี” |  “มีรายได้ระหว่างเรียน”ปรับเงินเดือน ผู้จบอาชีวะ” | มีศักดิ์ศรี มั่นคงในอาชีพ “สภาวิชาชีพจป./รปภ.” | ลดรายจ่ายสร้างรายได้ สว่างทั่วไทย “ไฟฟ้าโซล่าเซลล์/ชีวมวล เทคโนโลยีสะอาด” | “รับเอกสารสิทธิ ที่ดินซับซ้อน” “ชีวิตเกษตร เศรษฐกิจพอเพียง” | เพิ่มสวัสดิการ “ผู้สูงอายุ (ปี) 1,000 - 3,000 บาท” “ค่ารักษาพยาบาล หลังเกษียณของลูกจ้างประจำ, พนักงานราชการ,'),('ชาติไทยพัฒนา','055','IMG12','กัญจนา','ศิลปอาชา','18-04-51','มุ่งพัฒนาชาติไทย ด้วยนโยบายเสริมสร้างพื้นฐานเศรษฐกิจของประเทศให้มั่นคง สนับสนุนการเกษตรทันสมัยโดยการใช้เทคโนโลยี ฟื้นฟูประมง ส่งเสริมบัณฑิตวิชาการเกษตร ลดเหลื่อมล้ำทางการศึกษา ลดภาระครู สร้างแผนการพัฒนาการศึกษาแห่งชาติ ปราศจากการเมือง จัดสวัสดิการให้ทั่วถึง ส่งเสริมสุขภาพเชิงป้องกันก่อนเจ็บป่วย สนับสนุนการกระจายอำนาจบริหารสู่ท้องถิ่น พัฒนาเศรษฐกิจด้วยการท่องเที่ยว กระจายรายได้ไปสู่ทุกชุมชนอย่างสมดุล พร้อมพัฒนาเมืองให้สะดวกปลอดภัย อากาศสะอาด เป็นมิตรต่อสุขภาพและรองรับประชาชนทุกสภาพ-ทุกช่วงวัย เร่งพัฒนาและปฏิรูปประเทศไทยให้ก้าวผ่านความขัดแย้งเข้าสู่ยุคแห่งความเจริญที่ทันสมัยและยั่งยืน'),('อนาคตไทย','056','IMG13','พรศักดิ์','ธรรมนิมิตร์','25-04-51','NULL'),('ธรรมาภิบาลสังคม','059','IMG14','ชาญชัย','ตั้งชู','29-08-51','NULL'),('ภูมิใจไทย','063','IMG15','อนุทิน','ชาญวีรกุล','05-11-51','ทวงคืนกำไรให้เกษตรกร โดยเสนอกฎหมายระบบกำไรแบ่งปัน ตั้งกองทุนข้าว ข้าวหอมมะลิ ตันละ 18,000 บาท บวกกำไรเพิ่ม 1,500 บาท รวมเป็นเงิน 19,500 บาท มันสำปะหลัง ไม่ต่ำกว่า กก.ละ 4 บาท อ้อย ไม่ต่ำกว่าตันละ 1,200 บาท ปาล์มทะลาย ไม่ต่ำกว่า กก.ละ 5 บาท ยางพารา เป้าหมายราคา กก.ละ 70 บาท | ยกระดับ อสม. เป็นหมอประจำบ้าน ค่าตอบแทน 2,500 – 10,000 บาท ต่อเดือน | แก้หนี้ กยศ. โดยปลดภาระผู้ค้ำประกัน ไม่มีดอกเบี้ย ไม่มีค่าปรับ ผ่อนคืนเงินต้น 10 ปี และปลอดหนี้ 5 ปี | กัญชาไทย ปลูกได้เสรีโดยแก้ พ.ร.บ. ยาเสพติดให้โทษ นำกัญชามาใช้ในทางการแพทย์ เป็นพืชแก้จน ปลูกได้ สูบได้ ภายใต้กฎหมาย'),('ประชาธรรม','073','IMG16','ชานนท์','เจะหะมะ','16-04-52','NULL'),('สังคมประชาธิปไตยไทย','076','IMG17','ชาลี','ลอยสูง','25-06-52','กล้าหาญ เสียสละ ซื่อสัตย์สุจริต จิตสาธารณะ อุดมการณ์ของพรรค คุ้มครองศักดิ์ศรีความเป็นมนุษย์ให้มีความเสมอภาค ยึดมั่นในแนวทางปรัชญาเศรษฐกิจพอเพียง สร้างสังคมประชาธิปไตย ขจัดการทุจริตคอร์รัปชั่นแก้ความเหลื่อมล้ำเป็นวาระแห่งชาติ โดยจัดรัฐสวัสดิการสังคมแบบถ้วนหน้าพัฒนาคุณภาพคนเป็นสำคัญ การศึกษาฟรีถึงปริญญาตรี รักษาฟรีทุกโรค เพิ่มสิทธิประโยชน์ประกันสังคมและเงินทดแทน จัดเก็บภาษีแบบก้าวหน้า ปฏิรูปที่ดินและปลดหนี้สินที่ไม่เป็นธรรมให้เกษตรกร ส่งเสริมคุ้มครองระบบสหกรณ์ หยุดแปรรูปรัฐวิสาหกิจ กระจายหุ้นปตท. ให้ประชาชน ลดราคาน้ำมันให้เป็นธรรมแก่ผู้บริโภค ยุติการจ้างงานแบบชั่วคราว ค่าจ้างขั้นต่ำเท่ากันทั่วประเทศ'),('พลังคนกีฬา','082','IMG18','วิรุณ','เกิดชูกุล','28-10-52','เปิดโอกาสให้ผู้มีความสามารถจากภาคประชาชนเข้ามาบริหารประเทศในตำแหน่งรัฐมนตรี สนับสนุนให้ประชาชนได้มีส่วนร่วม การเมืองภาคพลเมืองอย่างจริงจังและเป็นรูปธรรม'),('รักประเทศไทย','089','IMG19','สุุรพนธ์','เวชกร','18-02-53','NULL'),('ประชาสามัคคี','091','IMG20','สมพร','จูมั่น','08-03-53','NULL'),('ไทยมหารัฐพัฒนา','096','IMG21','เชือก','โชติช่วย','06-07-53','NULL'),('เพื่อธรรม','098','IMG22','นลินี','ทวีสิน','23-08-53','สร้างสังคมสันติสุขให้เกิดขึ้นในหมู่ประชาชน ไม่ว่าจะนับถือศาสนาใด เพื่อร่วมแรงร่วมใจเป็นอันหนึ่งอันเดียวกันในการพัฒนาชีวิตความเป็นอยู่ของทุกคนให้ปลอดภัย และมีฐานะทางเศรษฐกิจที่ดีขึ้น | มุ่งแก้ปัญหาราคาพืชผลทางการเกษตรที่ตกต่ำ ทั้งยางพารา ปาล์ม และพืชเศรษฐกิจอื่นๆ รวมถึงการประมง และการค้าขายอื่น เพื่อยกระดับคุณภาพชีวิตของประชาชนให้มีหลักประกันทางอาชีพและรายได้ที่มั่นคง ยั่งยืน | มุ่งพัฒนาการท่องเที่ยวในพื้นที่จังหวัดภาคใต้ โดยสร้างและพัฒนาแหล่งท่องเที่ยวทางวัฒนธรรมและทางธรรมชาติ ควบคู่ไปกับการอนุรักษ์สิ่งแวดล้อมและวิถีชีวิตของชุมชน'),('ประชาธิปไตยใหม่','109','IMG23','สุรทิน','พิจารณ์','21-04-54','จัดตั้งกองทุนบำนาญประชาชน ให้บุคคลที่มีอายุ (ปี) 60 ปี ขึ้นไป รับบำนาญเดือนละ 3,000 บาท โดยแบ่งจ่ายสัปดาห์ละ 750 บาท | บัตรประชาชนมีมูลค่า 60,000 บาท สามารถนำมาประกันตัว ในชั้นสอบสวนและชั้นศาลได้ | จัดตั้งโรงพยาบาลรักษาหนี้ ปลูกต้นไม้ใช้หนี้ หนีโลกร้อน ตั้งกระทรวงศาสนา |  ส่งเสริมการใช้พลังงานแสงอาทิตย์ พลังงานทางเลือก สร้างระบบเก็บน้ำลงใต้ดินและนำน้ำมาใช้ | ปฏิรูปการศึกษา เป็นการศึกษาอัจฉริยะ (SMART EDUCATION) เรียนฟรีตั้งแต่เริ่มต้นจนถึงปริญญาตรี | กระตุ้นเศรษฐกิจ ด้วยนโยบาย Open Bangkok Open Thailand'),('พลังชล','112','IMG24','เชาว์','มณีวงษ์','04-05-54','NULL'),('สร้างไทย','115','IMG25','ประดิษฐ์','วงศ์วิลัย','02-06-54','NULL'),('ยางพาราไทย','116','IMG26','วรภัทร','ชำสุวรรณ','24-06-54','ผลักดันการใช้ยางพาราในประเทศอย่างเป็นรูปธรรมจริงจังและชัดเจน จัดตั้งกองทุนเสริมสร้างความมั่นคงในอาชีพและรักษาเสถียรภาพราคายาง สร้างระบบตลาดยางพาราให้ครอบคลุมครบวงจร ถูกต้องและเป็นธรรม สะสางปัญหาสวนยางในเขตที่ดินที่ไม่มีเอกสารสิทธิให้ชัดเจนและเป็นธรรม สนับสนุน สถาบันเกษตรกร ให้เป็นเกษตรอุตสาหกรรมอย่างเต็มรูปแบบ สนับสนุน อุตสาหกรรมของคนไทยในทุกด้านให้ก้าวไกล สู่ระดับโลก สร้างสังคมและชุมชนเข็มแข็ง ปลอดยาเสพติด ผลักดันแก้ปัญหาสิ่งแวดล้อม และปฏิรูประบบการศึกษา'),('ครูไทยเพื่อประชาชน','118','IMG27','ปรีดา','บุญเพลิง','28-06-54','ปฏิวัติการศึกษา คืนคุณค่าสู่สังคมไทย พร้อมก้าวไกลเทคโนโลยี บัตรคนดีปลดหนี้ประชาชน ผลิตภัณฑ์ชุมชนเพิ่มราคา ยางพารากิโลสองร้อย'),('พลังสหกรณ์','122','IMG28','จักรี','สุจริตธรรม','20-02-55','มุ่งแก้ไขฟื้นฟูระบบเศรษฐกิจของประเทศ ต่อต้านทุนใหญ่-ผูกขาดเอาเปรียบ ลดช่องว่างรวย-จน จะจัดการที่ดินของรัฐและนายทุนใหญ่มาสร้าง \"นิคมสหกรณ์\"\" ให้เกษตรกรรายย่อยเข้าทำกินให้เสร็จสิ้นใน 2 ปี/ส่งเสริมการแปรรูปเพิ่มมูลค่าสินค้าการเกษตรให้มีอุปกรณ์การตลาดของสหกรณ์ครบทุกตำบล ภายใน 2 ปี/ทุกหมู่บ้านมีร้านจำหน่ายผลิตผลแบบสหกรณ์ร้านค้า/เงินล้นระบบในสหกรณ์ได้รับการคุ้มครอง จัดตั้งธนาคารสหกรณ์/ปรับปรุงกฎหมายที่ไม่เป็นธรรมและปรับปรุงส่วนราชการที่เป็นอุปสรรค/ส่งเสริมปลูกไม้เศรษฐกิจแบบวนเกษตรปีละ 1 ล้านครอบครัว/สนับสนุนการศึกษาเรียนฟรีทุกระดับจนถึงปริญญาตรี นักศึกษามีงานทำระหว่างเรียน'),('พลังท้องถิ่นไท','124','IMG29','ชัชวาลล์','คงอุดม','30-03-55','ลดจำนวนหน่วยงานที่ทับซ้อนภารกิจ เปิดโอกาสให้ประชาชนมีส่วนร่วมในการบริหารราชการแผ่นดิน | การกระจายอำนาจเป็นวาระแห่งชาติ ให้ อปท. และราชการส่วนท้องที่ กำนันผู้ใหญ่บ้าน เป็นกลไกหนุนเสริมภาคประชาชน ยกระดับและพัฒนาคุณภาพชีวิตได้ด้วยตนเอง | จัดตั้งสภาพลเมืองเพื่อเป็นกลไกให้ประชาชนตรวจติดตาม แนะนำนักการเมือง และระบบราชการที่จัดบริการประชาชน | เปลี่ยนการศึกษาไทย ทักษะนำวิชาการ เชื่อมโยงระบบเศรษฐกิจฐานรากสู่เป้าหมายคนรุ่นใหม่มีรายได้ 500,000 บาทต่อปี | สร้างความมั่นคงทางรายได้ แก้จนครัวเรือน แก้จนชุมชน หนุนเสริมสินค้าชุมชน เป็นสินค้าสวัสดิการแห่งรัฐ | สร้างมาตรการแก้ปัญหายาเสพติด จับจริง – ลุยจริง จัดให้มีตำรวจชุมชนตรวจตรา 24 ชม. นำลูกหลานกลับสู่อ้อมกอดพ่อแม่'),('พลังเครือข่ายประชาชน','127','IMG30','สขภณ','ธีรชินคุณ','11-07-55','NULL'),('ถิ่นกาขาวชาววิไล','129','IMG31','ชุมชฎาธาร','หาญณรงค์','07-08-55','ยึดมั่นในการปกครองระบอบประชาธิปไตย อันมีพระมหากษัตริย์ทรงเป็นประมุข | ปัญหาของชาติต้องได้รับการแก้ไขด้วยธรรมวินัย ไตรสิกขา ศีล สมาธิ ปัญญา สนับสนุนส่งเสริมทุกศาสนา | จะส่งเสริมคนให้เป็นมนุษย์และเทวดา จะทำให้สังคมเป็นสังคมนิยมธรรม ให้คนได้รับการศึกษาอย่างทั่วถึง เรียนฟรีตั้งแต่ปฐมวัยจนถึงปริญญาตรี ให้ทุกคนรักษาพยาบาลฟรีทุกโรค ปฏิรูปพลังงาน ผลักดันราคาพืชผลทางการเกษตรให้มีราคาสูงขึ้น | เศรษฐกิจเป็นเศรษฐกิจพอเพียง ตามปรัชญาเศรษฐกิจพอเพียง การเมือง ใช้หลักคุณธรรมนำการเมือง ให้คนยากจนมีที่อยู่อาศัย ที่ทำกิน และเร่งแก้ปัญหาความยากจนและปัญหาจราจร กรุงเทพรถติด เศรษฐกิจย่ำแย่ สิ่งแวดล้อมเป็นพิษ ให้ทุกคนมีชีวิต'),('รักษ์ผืนป่าไทย','133','IMG32','ดำรงค์','พิเดช','09-01-56','1. เพิ่มป่าไม้ของประเทศจากการปลูกต้นไม้เพื่อสู้ภาวะโลกร้อน ประชาชนจะมีรายได้จากการปลูกต้นไม้ทดแทนโดยทางราชการจะเป็นผู้เพาะกล้าไม้ให้ 2. ที่ดินกรรมสิทธิ์และที่ดินที่รัฐจัดสรรให้สามารถตัดต้นไม้ที่ปลูกได้แต่จะไม่ได้รับเงินชดเชยภาวะโลกร้อน 3. พื้นที่ป่าสงวนแห่งชาติที่ราษฎรยากจนถูกจับให้ยุติคดีและให้เช่าพื้นที่จากกรมป่าไม้ 4. ยกเลิกชนิดพืชหวงห้ามและสัตว์ป่าคุ้มครองที่สามารถเพาะเลี้ยงได้บางชนิด 5. ห้ามใช้วัสดุที่ย่อยสลายได้ยากและให้ใช้พืชผักปลอดสารเคมีในการประกอบอาหารในสถานที่ราชการทุกแห่งทั่วประเทศไทย'),('ชาติประชาธิปไตยก้าวหน้า','141','IMG33','วิชิต','ดิษฐประสพ','28-06-56','NULL'),('เพื่อสันติ','142','IMG34','ปราโมทย์','สมะดี','18-07-56','NULL'),('พลังประเทศไทย','143','IMG35','สรินยา','คงมี','31-07-56','NULL'),('ไทรักธรรม','144','IMG36','พีระวิทย์','เรื่องลือดลภาค','16-08-56','พรรคไทรักธรรมมุ่งเน้นให้ประชาชนมีอาชีพเสริมเพิ่มรายได้จากอาชีพหลัก พร้อมจัดหาการตลาดให้อันนำไปสู่การลดภาระหนี้สิน เกิดเป็นเงินออมแก่ประชาชนอีกทั้งยังได้ระบบเงินปันผลโดยสหกรณ์ออนไลน์จากการทำอาชีพเสริม สร้างความเข้าใจแก่เกษตรกรไม่ให้เสียเปรียบนายทุน ให้เกษตรกรได้ลดต้นทุนการผลิต เพิ่มผลผลิตและราคาขายพืชผล อีกทั้งพรรคไทรักธรรมจะเป็นพ่อค้าคนกลางในสินค้าต่าง ๆ จนทำให้ประชาชนผู้บริโภคได้ซื้อในราคาถูก โดยสอนให้ประชาชนรู้จักผลิต รู้จักบริโภค และรู้จักค้าขาย นั้นคือ \"นโยบาย เพื่อปากท้องของประชาชน เมื่อประชาชนอยู่ดีกินดี ทุก ๆ ตำบลประเทศไทยจะพัฒนาและเจริญก้าวหน้าอย่างยั่งยืน\"\"\"'),('เสรีรวมไทย','145','IMG37','เสรีพิศุทธ์','เตมียเวส','29-08-56','หยุดความยากจน ลดความเหลื่อมล้ำของคนในชาติ | หยุดคอรัปชั่น นำงบประมาณมาพัฒนาประเทศ | หยุดปัญหายาเสพติด ขจัดผู้มีอิทธิพลให้สิ้นซาก | หยุดเผด็จการ ปฏิรูปทหาร | หยุดไฟใต้ สร้างสังคมสันติสุขสมานฉันท์ | หยุดสงครามสีเสื้อ สร้างความปรองดอง ก้าวสู่อนาคต'),('รักษ์ธรรม','147','IMG38','ศักดาวุธ','โกมลประเสริฐ','04-09-56','NULL'),('รวมพลังไทย','148','IMG39','อำนาจ','สอนทะมาตย์เดชา','11-09-56','NULL'),('เพื่อชาติ','149','IMG40','สงคราม','กิจเลิศไพโรจน์','18-09-56','เร่งสร้างและธำรงไว้ซึ่งการปกครองในระบอบประชาธิปไตยอันมีพระมหากษัตริย์ทรงเป็นประมุข การบริหารมีหลักธรรมมาภิบาล ขจัดการคอร์รัปชั่น มีสวัสดิการโดยรัฐ พัฒนาเศรษฐกิจทุกภาคส่วนอย่างสมดุลย์ พยุงราคาสินค้าการเกษตร ลดความเหลื่อมล้ำ นำหลักเศรษฐกิจพอเพียงมาเป็นหลักชัยในการพัฒนา เน้นการศึกษาสร้างคน สร้างงาน สร้างสังคมที่เข้มแข็งอบอุ่น ปลอดยาเสพติด ประชาชนมีความสุข มีสิทธิ เสรีภาพ และมีความเสมอภาคเท่าเทียมกัน'),('เพื่ออนาคต','150','IMG41','พูลเดช','กรรณิการ์','26-09-56','NULL'),('ชาติไทยสามัคคี','152','IMG42','นพพล','คงบันทึก','11-10-56','NULL'),('พลังประชาธิปไตย','153','IMG43','พูนพิพัฒน์','นิลรังษี','06-11-56','สร้างรัฐสวัสดิการจากครรภ์มารดาถึงวายชนม์ | มุ่งเน้นการกระจายอำนาจสู่ท้องถิ่น | เพิ่มสวัสดิการ กำนัน ผู้ใหญ่บ้าน อปพร. และ อสม. | ยกระดับโรงพยาบาลส่งเสริมสุขภาพตำบล เป็นโรงพยาบาลให้บริการเต็มรูปแบบ | การศึกษาให้เรียนฟรี จาก ป.1 ถึง ป.ตรี | จัดสรรทรัพยากรของชาติให้เป็นธรรม (ดิน น้ำ ลม ไฟ) | สนับสนุนให้ประชาชนและสื่อมวลชนมีส่วนร่วมในการแสดงออกอย่างเสรีและ เป็นธรรม | ปรับปรุง แก้ไข กฎหมายรัฐธรรมนูญ ให้สอดคล้องกับการเป็นอยู่ของวัฒนธรรมไทย และ นานาชาติ'),('ภราดรภาพ','154','IMG44','ดำรงดิศ','ดิศกุล','13-11-56','นโยบายพรรคภราดรภาพ ที่สามารถออกแบบได้จากคนไทยทุกคนมีส่วนร่วม เน้นการแก้ปัญหาด้านเศรษฐกิจและสังคม รวมไปถึง การสร้างความเท่าเทียมกัน นโยบายคนรวยต้องช่วยคนจนเพื่อลดความเหลื่อมล้ำ ส่งเสริมความสามัคคีของคนในชาติ พัฒนาประเทศให้มี ความเจริญรุ่งเรืองก้าวหน้าในทุกด้าน สร้างการเมืองไทยให้มีวัฒนธรรมที่ดีงามปราศจากการใส่ร้ายป้ายสี ไม่สร้างความแตกแยก สร้างโอกาสด้านการศึกษาให้ดีขึ้น สนับสนุนการปกครองระบอบประชาธิปไตยอันมีพระมหากษัตริย์ทรงเป็นประมุข'),('พลังไทยรักชาติ','155','IMG45','สุเทพ','เข้มแข็งปรีชานนท์','28-11-56','ประชาชนได้รับการบริการจากรัฐมาตรฐานเท่าเทียมกันทั้งหมด ประกันราคาข้าว เกวียนละ 15,000 บ. จะช่วยคนไทยที่ไม่มีที่อยู่อาศัยจะช่วยให้มีที่ของตนเอง คนละ 40 ตรว. ปราบปรามผู้มีอิทธิพลและยาเสพติดเป็นวาระแห่งชาติ อนุรักษ์ทรัพยากรธรรมชาติเป็นวาระแห่งชาติ ส่งเสริมนักวิทยาศาสตร์ในการคิดสร้างผลผลิต และคิดค้นทางด้านต่าง ๆ อย่างจริงจัง ครอบครัวคนจนเรียนฟรี อนุบาล ม.ปลาย กู้เรียนจบปริญญาไม่ต้องเสียดอกเบี้ย รักษาฟรีทุกโรค สำหรับคนจนและไม่มีเงิน ยื่นบัตรประชาชนขอรักษาฟรีได้เลย ประกันราคาผลิตผลทางการเกษตรทุกชนิดให้ได้ในราคาที่ต้องมีกำไร 3,000 – 5,000 บ. ขึ้นไป'),('เมืองไทยของเรา','156','IMG46','พิษณุ','พุทธสิม','28-11-56','NULL'),('เพื่อชีวิตใหม่','157','IMG47','ทองประเสริฐ','จันทรอัมพร','20-12-56','1. สนับสนุนให้มีโครงการอาหารกลางวันแก่นักเรียนนักศึกษาภาคบังคับโดยไม่มีค่าใช้จ่ายใดๆ 2. สนับสนุนให้มีโครงการรักษาในโรงพยาบาลของรัฐทุกแห่ง ทุกกรณี โดยไม่มีค่าใช้จ่ายใดๆ 3. สนับสนุนโครงการจัดสรรที่ดินแก่ประชาชนที่ไร้ที่ทำกิน ออกโฉนดที่ดินแก่ที่ครอบครองอย่างเสมอภาค 4. สนับสนุนให้ตั้งกองทุนทำปุ๋ยชีวภาพแจกจ่ายกันเองในกลุ่มเกษตรกรทุกภาคส่วน 5. สนับสนุนให้ตั้งคลินิกแก้จน ให้คำแนะนำปรึกษาแก้ไขปัญหาแก่ประชาชนทุกหมู่เหล่า 6. สนับสนุนให้มีการติดตั้งแผงโซล่าเซลล์ทุกครัวเรือน'),('เงินเดือนประชาชน','158','IMG48','กานท์ชญา','เทียนแก้ว','25-12-56','NULL'),('ปฏิรูปไทย','160','IMG49','พัฒนศักดิ์','ปิ่นศิริ','25-02-57','NULL'),('คนธรรมดาแห่งประเทศไทย','161','IMG50','ธนพร','ศรียากูล','05-03-57','เสนอนโยบายการปฏิรูปเชิงโครงสร้าง เพื่อนำพาประเทศก้าวสู่ความเป็นเสรีประชาธิปไตยอันเป็นสากล ด้วยการแก้ไขปรับปรุงกฎหมายที่ไม่สอดคล้องกับกาลสมัยและหลักนิติธรรม ส่งเสริมให้การกระจายอำนาจการปกครอง เพื่อเพิ่มประสิทธิภาพของรัฐในการตอบสนองความต้องการของประชาชน เพิ่มขีดความสามารถทางเศรษฐกิจและการแข่งขันของประเทศ ด้วยการขจัดการผูกขาดทางการค้า และส่งเสริมการทำเกษตรกรรมแบบอินทรีย์ ส่งเสริมความมั่นคงในชีวิตของประชาชน ด้วยการแก้ไขปัญหาที่ดินทำกิน และรับรองความเสมอภาคระหว่างบุคคลให้เท่าเทียมกัน'),('รักท้องถิ่นไทย','162','IMG51','จริญญา','รัตน์มณีบดีเดช','08-04-57','NULL'),('ผึ้งหลวง','164','IMG52','ก้องถพ','วังสุนทร','01-05-57','นโยบายกองทุนสร้างเศรษฐกิจและสังคม หมู่บ้าน / ชุมชนละ 20 ล้าน | นโยบายกองทุนพัฒนาเกษตรกรไทยสู่สากล | นโยบายปลดหนี้ - บำนาญประชาชน ด้วยไม้เศรษฐกิจ ไผ่กิมซุง 200,000 ล้าน | นโยบายประเทศไทย น้ำไม่ท่วม ไม่แล้ง | นโยบายปรับราคาประเมินที่ดินเกษตรกรรมไร่ละ 1 ล้าน | นโยบาย 1 อำเภอ 1 โรงงานแปรรูปการเกษตร 200 ล้าน | นโยบายประกันราคาสินค้าการเกษตรล่วงหน้า'),('มหาประชาชน','165','IMG53','มลฤดี','แย้มเกษสุคนธ์','06-05-57','NULL'),('เพื่อสหกรณ์ไทย','167','IMG54','วิเชียร','ปิ่ติสิทธิ์','16-05-57','พรรคเพื่อสหกรณ์ไทย“ปฎิรูปประเทศไทยด้วยวิถีสหกรณ์” แนวนโยบาย ( สร้างเกษตรและสถาบันเกษตรกรให้เข้มแข็งด้วยระบบสหกรณ์ตั้งแต่ระดับตำบลถึงระดับชาติ | สร้างสวัสดิการและการเงินชุมชนด้วยระบบสหกรณ์ | สร้างเศรษฐกิจฐานรากให้ยั่งยืนด้วยระบบสหกรณ์ “เกษตรกรอยู่รอด สวัสดิการชุมชนเข้มแข็ง เศรษฐกิจฐานรากยั่งยืน”)'),('เอกราชไทย','168','IMG55','กัมปนาท','เพิ่มสุข','19-05-57','NULL'),('ประชาธิปไตยเพื่อประชาชน','169','IMG56','ประมวล','พิมพ์เสน','21-05-57','อำนาจในการปกครองเป็นของประชาชน ระบบเศรษฐกิจใช้หลักสหกรณ์และหลักเศรษฐกิจพอเพียง สร้างสังคม บวร ด้วยหลักพุทธธรรมและรักษาหลักวินัยบัญญัติของพระพุทธเจ้า พัฒนาฝีมือแรงงานให้ตรงและเพียงพอต่อการจ้างงาน คุ้มครองสิทธิเสรีภาพและสวัสดิการแรงงานทั้งขณะจ้างงานและวัยเกษียณ ผู้สูงวัยมีคุณภาพด้วยภูมิปัญญาไทย จัดการศึกษาทั้งในระบบและตลอดชีพ คนไทยต้องมีทักษะในวิชาชีพหลายประเภท การสาธารณสุขให้ใช้ระบบรัฐสวัสดิการ คนไทยสุขภาพดีถ้วนหน้าด้วยกีฬาและสมุนไพรไทย ใช้ระบบไกล่เกลี่ยเบื้องต้น ขจัดกระบวนการยุติธรรมสองมาตรฐาน ยกเลิกการเกณฑ์ทหาร นำทรัพยากรพลังงานของชาติกลับมาเป็นของประชาชน ส่งเสริมนโยบายการรักษาป่าด้วยระบบธนาคารต้นไม้ นำพาประเทศไทยให้เป็นผู้นำในองค์กรระหว่างประเทศฯ'),('ทางเลือกใหม่','170','IMG57','ราเชน','ตระกูลเวียง','02-08-61','“เงินทุนเจ้าบ้าน เพื่อเศรษฐกิจไทยทุกครัวเรือน” ส่งเสริมเศรษฐกิจในครัวเรือนโดยตรงโดยการกระตุ้นเศรษฐกิจด้วยการให้สินเชื่อผ่านเจ้าบ้านที่มีชื่อในทะเบียนบ้านเพื่อยกระดับการพัฒนาประเทศผ่านทางเจ้าบ้านทุกครัวเรือน ส่งเสริมการเกษตรโดยหลักประเทศไทย ต้องเป็นศูนย์กลางการค้าพืชผลทางการเกษตรโลกและให้ความสำคัญโดยหลักคนไทยต้องมาก่อน (Thai first) เพื่อประชาชนคนไทยทั้งที่อยู่ในประเทศและต่างประเทศทั่วโลกจะได้รับความคุ้มครองดูแลในทุกมิติ จัดตั้งกระทรวงกีฬาโดยแยกการบริหารการกีฬาเป็นกระทรวงโดยเฉพาะ ด้วยตระหนักถึงความสำคัญของการกีฬาต่อการพัฒนาสุขภาพและศักยภาพของคนไทย นโยบายบริการรักษาโรคตลอด 24 ชั่วโมง รวมทั้งนโยบายศูนย์กลางอาหารฮาลาลโลกพรรคทางเลือกใหม่'),('มติประชา','171','IMG58','อนุชิต','งามเบญจวิชัยกุล','03-08-61','กระจายอำนาจให้ประชาชนมีส่วนร่วมกับกฎหมาย การเมือง การปกครอง ในระบอบประชาธิปไตย โดยผ่านเครื่องมือที่ง่ายและสะดวก เช่น โทรศัพท์มือถือ มากกว่าการทำหน้าที่เพียงไปลงคะแนนเสียงในวันเลือกตั้งเท่านั้น กระจายรายได้ เสริมสร้างเศรษฐกิจจากฐานราก สนับสนุนองค์ความรู้ภูมิปัญญาท้องถิ่น และเทคโนโลยีการจัดการเงินทุนและการตลาด ด้านการศึกษา ส่งเสริมการศึกษาเพื่อใช้ในการประกอบอาชีพ เพื่อให้มีทรัพยากรมนุษย์ที่เหมาะสมกับประเทศในอนาคต มีความสามารถทางภาษาเพื่อใช้ในการสื่อสาร และความสามารถในการคิดวิเคราะห์เพื่อใช้ในการตัดสินใจ'),('ประชาภิวัฒน์','172','IMG59','สมเกียรติ','ศรลัมพ์','10-08-61','จัดตั้งสำนักงานเลขานุการพระสังฆาธิการทุกระดับ | หนึ่งจังหวัดหนึ่งพุทธมณฑล | กำหนดค่าตอบแทนสำหรับไวยาวัจกร 9,000 บาทต่อเดือน | จัดตั้งธนาคารพระพุทธศาสนา | ส.ป.ก. เปลี่ยนมือได้ ใช้ประโยชน์อื่นได้หลากหลาย | ตั้งโครงการประเมินกู้แบงค์ได้ | กัญชาล้านไร่กระจายรายได้ให้ประชาชนทุกระดับ | นำเงินดูแลผู้สูงอายุท่านละ 5,000 บาท | สนับสนุนเบี้ยยังชีพสำหรับแม่เลี้ยงเดี่ยว (Single Mom) 10,000 บาท ต่อเดือน | ปรับโครงสร้างหนี้บัตรเครดิตและล้างประวัติระบบเครดิตบูโร'),('พลเมืองไทย','173','IMG60','ศิลัมพา','เลิศนุวัฒน์','10-08-61','ยึดมั่นประชาธิปไตย ตัดสินใจโดยท้องถิ่น | ยุบหน่วยงานภาครัฐที่ล้าหลัง สร้างหน่วยงานที่รับผิดชอบต่อพลเมืองไทย โดยใช้เทคโนโลยีดิจิทัล | ปฏิวัติระบบการป้องกันและปราบปรามการทุจริตตามมาตรฐานสากล เพื่อลงโทษคนทุจริตโดยเร่งด่วน | เพิ่มโอกาสทำมาหากินของทุกคนทุกพื้นที่ด้วยเทคโนโลยีดิจิทัล โดยต่อยอดจากตลาดท้องถิ่นสู่ตลาดสากล | พลเมืองไทยร่วมกันสร้าง \"สังคมสวัสดิการ\"\" เพื่อดูแลคนจน คนพิการ ผู้ด้อยโอกาส และผู้สูงอายุ | ให้ท้องถิ่นตรวจสอบการทอดทิ้งที่ดิน เพื่อยึดเป็นของรัฐตามกฎหมายที่ดิน และจัดสรรที่ดินให้คนจนที่ยากไร้\"'),('รวมใจไทย','174','IMG61','นพดล','อมรเวช','31-08-61','มุ่งมั่น นำไทยสู่อุดมการณ์ประชาธิปไตย พร้อมขับเคลื่อนยุทธศาสตร์ ๔ สร้าง เพื่อประชาชนและสังคมที่ดี ( สร้างอำนาจปกครองยุติธรรม, สร้างสังคมยุติธรรม, สร้างนำเศรษฐกิจประชาชน, สร้างชีวิตคนคุณภาพ) | ขับเคลื่อนนโยบายหลัก 5 ทำ สู่มาตรฐานชีวิตที่ดี ( ภาษีมูลค่าเพิ่มเพื่อการครองชีพ 0%, วุฒิการศึกษาค้ำประกันเงินกู้เพื่อการลงทุนประกอบอาชีพ สูงสุด 1 ล้านบาท, โรงพยาบาลตำบล 1 แพทย์ 2 พยาบาล, ธนาคารตำบล เพื่อการลงทุนและการศึกษา, 1 ตำบล 1 ศูนย์ภาษาอาเซียน ) | และขับเคลื่อน 4 ผลักดัน ( นิคมอุตสาหกรรมเกษตรภูมิภาค, กองทุนข้าวและพืชผลหลัก, อุโมงค์ผันน้ำและชลประทานระบบท่อเพื่อเกษตรกรรม, ผลิตภัณฑ์สินค้าเกษตร ทีจีแบรนด์ (TG-BRAND) เพื่อการบริโภคและส่งออกสร้างรายได้)'),('พลังธรรมใหม่','175','IMG62','ระวี','มาศฉมาดล','14-09-61','ปลดแอกประเทศไทยสู่สังคมธรรมาธิปไตย โดย คอร์รัปชั่น 0% -คดีทุจริตไม่มีอายุ (ปี) ความ,ทุจริตเกิน 50 ล้านประหารชีวิต ถ้ารับสารภาพเหลือจำคุกตลอดชีวิต, เอาน้ำมัน-แก๊สของคนไทยคืนมา ราคาต้องเป็นธรรม ลดราคาน้ำมัน 5 บาท/ลิตร แก๊สหุงต้ม 250 บาท/ถัง, หมอประจำตัวทั่วไทย ภายใน 1 ปี คนไทยทุกคนมีหมอประจำตัว ใส่ใจการแพทย์ผสมผสาน จัดการอาหารปลอดภัย, ปรับลด ปลดหนี้ ลดรายจ่าย เพิ่มรายได้ ด้วยเศรษฐกิจพอเพียง ใช้เศรษฐกิจพอเพียง นำเศรษฐกิจไทยสู่ความยั่งยืน, เกษตรกรทุกคนต้องมีที่ดินทำกิน โดยการตั้งเขตเศรษฐกิจพอเพียง ยกระดับราคาสินค้าเกษตรอย่างบูรณาการและยั่งยืน'),('ประชาชนปฏิรูป','176','IMG63','ไพบูลย์','นิติตะวัน','03-10-61','น้อมนำคำสอน “พระพุทธเจ้า” มาปฏิบัติ เพื่อแก้ไขปัญหา “ทุกข์ร้อน” ให้ประชาชนอย่างยั่งยืน | ให้พรรคประชาชนปฏิรูปเป็น “องค์กรสาธารณกุศลระดับชาติ” โดยจัดตั้ง “สภาประชาชนปฏิรูปจังหวัด” ทั้ง 77 จังหวัด เพื่อเป็นเครื่องมือของประชาชน ในการตรวจสอบถ่วงดุล เจ้าหน้าที่รัฐ หน่วยงานของรัฐในจังหวัดนั้น และแก้ไขปัญหาทุกข์ร้อนให้ประชาชนด้วยกฎหมายจนถึงที่สุด | เป็น “พรรคฝ่ายคุณธรรม” สร้างมิติใหม่ของพรรคการเมือง เป็นผู้นำในการปฏิรูปพรรค ปฏิรูปการเมือง ปราศจากการให้อามิสสินจ้างอย่างแท้จริง และพรรคประชาชนปฏิรูปดำเนินการด้วยความเปิดเผย โปร่งใส ตรงไปตรงมา โดยมี “นายไพบูลย์ นิติตะวัน” หัวหน้าพรรคเป็นผู้รักษาหลักการของพรรค'),('อนาคตใหม่','177','IMG64','ธนาธร','จึงรุ่งเรืองกิจ','03-10-61','พรรคอนาคตใหม่จะพัฒนาประเทศไทยให้คนไทยเท่าเทียมกัน ประเทศไทยเท่าทันโลก ด้วยการกระจายอำนาจสู่ในท้องถิ่น สร้างสวัสดิการประชาชนถ้วนหน้า ปฏิวัติการศึกษา ทลายเศรษฐกิจผูกขาด หยุดการเอื้อประโยชน์ระหว่างรัฐบาลและกลุ่มทุนขนาดใหญ่ สร้างระบบขนส่งสาธารณะเพื่อทุกคน ยกระดับการภาคเกษตรสู่เกษตรก้าวหน้าด้วยเทคโนโลยี พัฒนาเศรษฐกิจดิจิทัลเพื่อประชาชน แก้ปัญหาทุจริตด้วยการสร้างรัฐเปิดเผย เปิดรับความแตกต่างหลากหลายในสังคม สร้างสิ่งแวดล้อมยั่งยืน ปฏิรูปกองทัพ ปรับลดงบประมาณกระทรวงกลาโหม เลิกระบบเกณฑ์ทหาร ล้มล้างมรดก คสช. คืนประชาธิปไตยและสิทธิมนุษยชน'),('ไทยธรรม','178','IMG65','อโณทัย','ดวงดารา','24-10-61','ด้านการเกษตร : การประกันรายได้พืชผลทางการเกษตรของพี่น้องเกษตรกรต้องได้รับการประกันราคาที่พออยู่พอกินและทำได้จริงๆ | ด้านแรงงาน : ผู้ใช้แรงงานมีชีวิตที่ดีขึ้น พนักงานลูกจ้างชั่วคราว (ซัพคอนแทคน์) ต้องได้รับสิทธิขั้นพื้นฐาน เช่น ค่าแรง, โบนัส, สิทธิการบรรจุต้องเท่าเทียมพนักงานประจำ | ด้านผู้สูงวัย : เพิ่มเบี้ยยังชีพให้มากขึ้น ให้ดำรงชีพได้พออยู่พอกินตามสภาพสังคมปัจจุบัน | ด้านการศึกษา : การศึกษาเรียนฟรี 15 ปี ต้องได้เรียนฟรีจริง ๆ'),('เพื่อนไทย','179','IMG66','สิระ','พิมพ์กลาง','24-10-61','เป็นนโยบายด้านเศรษฐกิจ การศึกษาให้ได้รับการศึกษาถึงขั้นปริญญาตรีเป็นอย่างต่ำ ด้านสวัสดิการสังคม ต้องดูแลสังคมผู้สูงวัยให้มีเบี้ยผู้สูงอายุขึ้น ตามสภาวะปัจจุบัน ด้านการเมืองไม่ฝักใฝ่ฝ่ายการเมืองใดการเมืองหนึ่ง เน้นความสามัคคีของคนในชาติ ศรัทธาในระบอบประชาธิปไตยอันมีพระมหากษัตริย์ทรงเป็นพระประมุข และจะดำเนินนโยบายทุกอย่างบนความเป็นไปได้โดยไม่ขัดต่อแผนพัฒนาประเทศ 20 ปี'),('ไทยศรีวิไลย์','180','IMG67','มงคลกิตต์','สุขสินธารานนท์','24-10-61','ฟื้นเศรษฐกิจ ซ่อมฟิตระบบราชการ ปราบโกง โปร่งใส พรรคไทยศรีวิไลย์'),('รวมพลังประชาชาติไทย','181','IMG68','จัตุมงคล','โสณกุล','26-10-61','ย้ำปฏิรูป: ที่สำคัญเอาทรัพยากรและอำนาจจากส่วนกลางให้จังหวัด ซึ่งมีผู้ว่าราชการที่ประชาชนเห็นชอบ | เศรษฐกิจชาวบ้านสำคัญที่สุด: ให้เกษตรกรขายพืชผลได้กำไรร้อยเปอร์เซ็นต์ของต้นทุน, ส่งเสริมเกษตรอินทรีย์-ปลอดสารพิษ, มีเขตพิเศษ “ทุ่งกุลา” เป็นต้นแบบ “พอเพียง”, ปลูกไม้ยืนต้นเพื่อใช้หรือขายได้, เปลี่ยนการท่องเที่ยวเป็นของชุมชนและครัวเรือนแทนที่เป็นเพียงของภาคธุรกิจ,จัดกองทุนให้ชาวบ้านกู้ยืมเพื่อที่อยู่อาศัยและพ้นจากหนี้นอกระบบ, เรียนอาชีวะและวิชาชีพฟรี จบแล้วรายได้ดี | จัดแพทย์และพยาบาลประจำรพ.สต., ยกคุณภาพ รพ. ชุมชนให้เท่า รพ. จังหวัด, อบรม อสม. มาบริบาลผู้สูงวัยและผู้พิการ โดยมีค่าตอบแทน'),('สยามพัฒนา','182','IMG69','บุญส่ง','เกิดหลำ','26-10-61','ส่งเสริมและพัฒนาการศึกษาให้มีการเรียนการสอน 3 ภาษาในสถานศึกษา (ไทย,จีน,อังกฤษ) | กำหนดราคาพืชเศรษฐกิจทุกชนิดส่งเสริมและพัฒนาเศรษฐกิจแบบเกินดุล | ด้านการปกครอง ให้มีการกระจายอำนาจสู่ท้องถิ่นอย่างแท้จริง | ด้านยุติธรรม ปฏิรูปกฎหมายที่ไม่เป็นธรรม เพื่อให้เกิดประโยชน์กับพี่น้องประชาชน | ด้านทรัพยากรธรรมชาติ บริหารจัดการน้ำอย่างเป็นระบบ แสวงหาพลังงานทดแทน | ด้านสังคม จัดให้เป็นรัฐสวัสดิการอย่างสมเหตุสมผล โดยเพิ่มเบี้ยยังชีพผู้สูงอายุและคนพิการอย่างยั่งยืน'),('เพื่อคนไทย','183','IMG70','วิทยา','อินาลา','29-10-61','ใช้ศาสตร์พระราชาเพื่อเป็น : ตำบลอัจฉริยะ 4 สร้าง : 5 เป้าหมาย ( สร้างปัญญา : โรงเรียนอัจฉริยะ | สร้างเศรษฐกิจ : คนไทยอยู่ดีมีสุข เกษตรกร และ SME ทุกคนมีบัตรคนรวย กองทุนบำเหน็จบำนาญเกษตรกร กองทุนบำเหน็จบำนาญวิสาหกิจขนาดกลางและขนาดย่อม (SMES) | สร้างสุขภาพ : คนไทย 90 ปี สุขภาพดีถ้วนหน้า | สร้างวัฒนธรรมสร้างชาติ : ครอบครัวไทย มีความอบอุ่น ชุมชนไทยเข้มแข็ง ลดความเหลื่อมล้ำในสังคม )'),('พลังปวงชนไทย','184','IMG71','นิคม','บุญวิเศษ','29-10-61','เสริมฐานรากเก่าสร้างฐานรากใหม่ เพื่อประเทศไทยมั่นคงเศรษฐกิจมั่งคั่งและยั่งยืน | เปิดประเทศไทย 24 ชั่วโมง | 30 บาท รักษาทั่วไทย O-VOG หนึ่งผลิตภัณฑ์ หนึ่งสินค้าชุมชน | เกษตรกรปลอดหนี้ภายในสามปีสร้างฐานะดีร่ำรวยภายใน 5 ปี ส่งเสริมให้เกษตรกรไทยหายจนอย่างยั่งยืน | นิรโทษกรรม นักธุรกิจเก่าด้วยการทบทวนปลดเครดิตบูโร | จัดสรรที่ดินรัฐให้ประชาชนได้อยู่อาศัยและทำกิน | สวัสดิการประชาชนเกิดจากการใช้จ่าย มีรายได้คืน, พนักงานบริษัทต้องมีสวัสดิการเทียบเท่าข้าราชการ'),('พลังไทยรักไทย','185','IMG72','คฑาเทพ','เตชะเดชเรืองกุล','30-10-61','พักหนี้เกษตรกร 3 ปี ตั้งกองทุนหมู่บ้าน ๆ ละ 3,000,000 พร้อมต่อยอด OTOP 30 บาทรักษาทุกโรคได้จริง พลังแผ่นดินปลอดยาเสพติด อิสานเขียวภาค 2 เมกโปรเจค โขงชีมูลปิงวังยมน่าน พื้นที่การเกษตรมีน้ำตลอดปี เปลี่ยน สปก. เป็นโฉนด ใต้ร่มเย็นเน้นการพัฒนาฟื้นฟูคุณภาพชีวิต เพิ่มสวัสดิการพื้นฐานผู้สูงอายุ คนพิการและผู้ด้อยโอกาสให้สูงขึ้น ตั้งกองทุนแห่งรัฐพัฒนาประเทศ ตั้งบรรษัท เกษตรแห่งชาติจำกัด (มหาชน) สร้างท่าเรือน้ำลึกอ่าวไทยอันดามันเชื่อมด้วยรถไฟรางคู่ 1 ตำบล 1 ธนาคาร 1 จังหวัด 1 แหล่งท่องเที่ยว 1 ตำบล 1 ทุน ทุนการศึกษาจบปริญญาตรีฟรี มีงานทำ'),('พลังชาติไทย','186','IMG73','ทรงกลด','พิพย์รัตน์','31-10-61','“หาเงินก่อน ทำนโยบาย” เกิดขึ้นเป็นครั้งแรกของประเทศไทย จึงไม่เหมือนใครหรือพรรคใดเพราะ “เงิน” เท่านั้นที่จะแก้ไขปัญหาของประเทศได้ทั้งหมด “พรรคพลังชาติไทย” มี 5 โครงการหาเงิน (กกต.รับรองและถูกต้องตามกฎหมายแล้ว) คือ ขุดคลองไทย, เปิดสถานบันเทิงครบวงจร เช่น ลาสเวกัส, ทำเกษตรอินทรีย์ทั้งประเทศ, เปลี่ยนแปลงการท่องเที่ยวเป็นมาตรฐานสากล และเปิดศูนย์กลางการเงินของโลก รวมรายได้มากมายมหาศาลกว่า 18 ล้านล้านบาท/ปี เป็น “รัฐสวัสดิการ” เช่น ผู้สูงอายุได้ 5,000 บาทต่อเดือน / อสม., อปพร. ...ได้ 5,000 บาทต่อเดือน / สร้างร้านค้าตำบลให้ชาวบ้านทั้ง 7,255 ตำบลทั้งประเทศ และพัฒนาคุณภาพชีวิต เช่น เลิกหนี้ (ล้างหนี้ - ยกหนี้ – ปลดหนี้) ให้ประชาชน'),('ประชาชาติไทย','187','IMG74','วันมูหะมัดนอร์','มะทา','31-10-61','แก้ปัญหาของชาติด้วยวิถีทางประชาธิปไตยอันมีพระมหากษัตริย์ทรงเป็นประมุขที่ธำรงไว้ซึ่งหลักนิติธรรม ส่งเสริมสังคมพหุวัฒนธรรมที่เคารพให้เกียรติในความแตกต่างหลากหลายทางวัฒนธรรม ยกเลิกและปฏิรูปกฎหมาย กระบวนการยุติธรรม ระบบงบประมาณและภาษีอากรให้เกิดความเป็นธรรม ส่งเสริมระบบรัฐสวัสดิการด้านการศึกษา การรักษาพยาบาลฟรี ระบบบำนาญและสวัสดิการ (เบี้ยผู้สูงอายุ (ปี) 3,000 บาท / เดือน) ยกระดับโครงสร้างพื้นฐานด้านสาธารณูปโภคและคมนาคม แก้ไขปัญหาความยากจน หนี้สิน ความเหลื่อมล้ำทั้งด้านเศรษฐกิจ, สิทธิเสรีภาพ, กฎหมาย, ศักดิ์ศรีและเชิงพื้นที่ ขจัดการทุจริต เกษตรกรมีที่ดินทำกินและเป็นเจ้าของกรรมสิทธิ์ในที่ดิน แก้ไขปัญหาน้ำทั้งระบบ สินค้าเกษตรให้ขายได้ราคาสูงสุด ส่งเสริมการท่องเที่ยวและการกีฬา แก้ปัญหายาเสพติด'),('แผ่นดินธรรม','188','IMG75','กรณ์','มีดี','02-11-61','ธนาคารพุทธธนาคารเพื่อชาวพุทธ | บัญญัติให้พระพุทธศาสนาเป็นศาสนาประจำชาติ | เพิ่มวิชาสมาธิภาวนาเป็นวิชาบังคับในโรงเรียนทุกระดับ | ยกเลิกกองทุนน้ำมันดีเซลและลดราคาน้ำมันทุกชนิด | 1 จังหวัด 1 โรงพยาบาลแพทย์แผนไทย | ตั้งกระทรวงชาวนาและกระทรวงยางพารา | แก้กฎหมายความเร็วรถให้เหมาะกับสภาพรถและถนนปัจจุบัน | พักใช้ข้อมูลเครดิตบูโร 1 ปี | นิคมไทยพุทธ 3 จังหวัดชายแดนใต้ | ให้โรงเรียนพระปริยัติสามัญเป็นโรงเรียนของรัฐ'),('คลองไทย','189','IMG76','สายัณห์','อินทรภักดิ์','02-11-61','ผลักดันโครงการคลองไทยด้วยการเสนอร่างพระราชบัญญัติคลองไทยในสภาผู้แทนราษฎรให้มีกฎหมายรองรับโครงการคลองไทย เพื่อนำรายได้จากโครงการคลองไทยไปพัฒนาเศรษฐกิจและสังคมของประเทศให้มีความมั่นคง มั่งคั่ง ยั่งยืน | แก้ไขปัญหาของประเทศด้านพลังงาน ที่ดินทำกิน ยาเสพติด การทุจริตคอรัปชั่น การค้ามนุษย์ | พัฒนาประเทศตามแผนพัฒนาเศรษฐกิจและสังคมแห่งชาติและแผนงบประมาณรายจ่ายของรัฐให้เกิดประสิทธิภาพสูงสุด'),('ประชาธรรมไทย','190','IMG77','พิเชษฐ','สถิรชวาล','02-11-61','นโยบายยกระดับคุณภาพชีวิตประชาชนและเพิ่มรายได้ให้กับประชาชนอย่างเท่าเทียมกันในด้านการศึกษา สาธารณสุข ประกันอนาคตชีวิตให้แก่เด็กแรกเกิด สร้างความเสมอภาคและสิทธิเสรีภาพอันเท่าเทียมกัน ให้กับประชาชนทุกเพศ ประกอบกับเพิ่มคุณภาพชีวิตให้กับคนพิการและผู้สูงวัยในด้านการศึกษา คนไทยต้องได้เรียนฟรีอย่างคุณภาพ อย่างเท่าเทียมกัน ตลอดจนพัฒนาคุณภาพชีวิตครูและบุคลากรทางการศึกษาทั้งภาครัฐและเอกชน ด้านเศรษฐกิจ การเพิ่มมูลค่าให้กับสินค้าเกษตร รวมถึงสนับสนุนทุกกลุ่มอาชีพ เปิดตลาดส่งออกใหม่ ขยายตลาดการท่องเที่ยวให้ดีขึ้น ขยายความสัมพันธ์ที่ดีขึ้นกับนานาประเทศเพื่อเพิ่มตลาดการลงทุน การส่งออก และการท่องเที่ยว'),('ประชานิยม','191','IMG78','ยงยุทธ','เทพจำนงค์','07-11-61','ให้นายจ้างจ่ายเงินประกันสังคมแทนลูกจ้างทั้งหมด ยกเลิกหักเงินเดือนลูกจ้างร้อยละ 5 ที่นำส่งประกันสังคมสูงสุด 9,000 บาท / คน / ปี, ค่าแรงขั้นต่ำ 360 บาท / คน / วัน ทั่วประเทศ, หยุดกองทัพซื้ออาวุธ 10 ปี นำเงิน 400,000 ล้านบาท ไปพัฒนาประเทศ, เปลี่ยนงบซื้อรถถัง ไปซื้อรถโดยสารปรับอากาศ 10,000 คัน เปลี่ยนงบซื้อรถถัง ไปซื้อรถไถนา, รถดำนา, รถเกี่ยวนวดข้าวประจำหมู่บ้าน และรถตัดอ้อยให้ชาวนา ชาวไร่ใช้ฟรี รับซื้อน้ำยางพาราสด 80 บาท / กิโลกรัม, ผลปาล์มสด 4 บาท / กิโลกรัม, สร้างโรงงานผลิตหมอนยางพารา, ยางรถยนต์ สร้างอาคารรักษาพยาบาลในโรงพยาบาลเพิ่ม 100,000 เตียง, ธนาคารครู, รถตู้ รับ - ส่ง นักเรียน ประจำตำบล'),('พลังประชารัฐ','192','IMG79','อุตตม','สาวนายน','07-11-61','สวัสดิการประชารัฐ เพื่อขจัดความเหลื่อมล้ำผ่านบัตรประชารัฐ การให้สวัสดิการรายกลุ่ม ลดหนี้สร้างเงินออม และช่วยเหลือด้านที่อยู่อาศัยและที่ทำกิน | สังคมประชารัฐ เพื่อสร้างสังคมสงบสุข เข้มแข็งแบ่งปัน ผ่านการพัฒนา การศึกษา การกระจายความเจริญ การสร้างเมืองอัจฉริยะสีเขียว การพัฒนาชุมชนสีขาว กรุงเทพ 5.0 | เศรษฐกิจประชารัฐ เพื่อสร้างความสามารถและโอกาสที่เท่าเทียม ผ่านการยกระดับความสามารถผู้ผลิต การเกษตรประชารัฐ การท่องเที่ยวชุมชนและเศรษฐกิจสร้างสรรค์ เศรษฐกิจชีวภาพ การพัฒนาโครงสร้างพื้นฐานแห่งอนาคต และการลดอุปสรรคในการดำเนินธุรกิจ'),('เศรษฐกิจใหม่','193','IMG80','มิ่งขวัญ','แสงสุวรรณ','08-11-61','ได้เวลาความสุขของคนไทยทั้งประเทศด้วยระบบเศรษฐกิจใหม่ ( วางตำแหน่งประเทศไทย เพื่อความได้เปรียบและมีศักยภาพสูงในการแข่งขัน, หารายได้เข้าประเทศโดยสร้างระบบการเงินเสรี, ศูนย์กลางการเงิน, พลังงาน, การแพทย์ และอื่นๆ, ดูแลความมั่นคงปลอดภัยในชีวิตและทรัพย์สินของคนไทย, สร้างความสัมพันธ์อันดี ทั้งการค้า การลงทุน การทูตกับนานาชาติ)'),('ไทยรุ่งเรือง','194','IMG81','ฉัตรชัย','แนวพญา','08-11-61','คุณธรรมนำการเมืองพูดความจริง ทำในสิ่งที่เป็นไปได้ ทำทุกเรื่องเพื่อประเทศชาติพัฒนาและประชาชนมีความสุข ให้ประชาชนมีส่วนร่วมในการนำเสนอนโยบายและพร้อมที่จะนำไปปฏิบัติ'),('พลังรัก','195','IMG82','ภรัณ','กิตติวัฒน์','21-11-61','คงไว้ซึ่งระบอบประชาธิปไตยอันมีพระมหากษัตริย์เป็นประมุข พัฒนาคนไทยให้มีศักดิ์ศรี มีภาวะผู้นำเป็นคนดี มีความรู้ความสามารถ และศีลธรรมอันดี สร้างความรัก สามัคคี ส่งเสริมธุรกิจชุมชน โดยประชาชน และเอกชนให้มีส่วนร่วมในการบริหารจัดการในการสร้างรายได้ระดับชุมชนและระดับชาติ แก้ปัญหาเศรษฐกิจตามศาสตร์พระราชา'),('ชาติพันธุ์ไทย','196','IMG83','พลศุภรักษ์','ศิริจันทรานนท์','21-11-61','ธำรงไว้ซึ่งการปกครองในระบอบประชาธิปไตยอันมีพระมหากษัตริย์เป็นประมุข ยึดมั่นในสถาบันชาติ ศาสนา และพระมหากษัตริย์ มุ่งเน้นความรู้รัก สามัคคีภายในชาติ ที่มีความหลากหลายทางชาติพันธุ์ซึ่งทุกคนเป็นคนไทยเหมือนกันมีความเสมอภาค เท่าเทียมและยุติธรรมไม่มีการแบ่งแยกแตกต่างระหว่างกัน ส่งเสริมการมีส่วนร่วมทุกภาคส่วน | กระจายอำนาจสู่ท้องถิ่นโดยยึดถือฐานรากแห่งสังคม อัตลักษณ์และวัฒนธรรมที่หลากหลาย | ปรับปรุงแก้ไขกฎหมายและการบริหารราชการแผ่นดินเพื่อนำไปสู่การสร้างสังคมแห่งโอกาสและความเท่าเทียมเสมอภาคและเป็นธรรม พร้อมที่จะก้าวเดินไปด้วยกัน'),('ภูมิพลังเกษตรกรไทย','197','IMG84','คำนึง','พุฒหอม','26-11-61','ควบคุมต้นทุนการผลิตให้ต่ำกว่าราคาผลผลิต นำนวัตกรรมเทคโนโลยีการเกษตรสมาร์ทฟาร์มเมอร์มาช่วยรักษาคุณภาพผลผลิต จัดสรรการใช้น้ำให้พอเพียง จัดสรรทุนการศึกษาให้บุตรหลานเกษตรกรเรียนฟรีถึงปริญญาโทในสถานศึกษาของรัฐ รักษาพยาบาลฟรี หัวหน้าครอบครัวเกษตรกรมีสวัสดิการให้สามารถเลี้ยงครอบครัวได้ภายหลังอายุ 60 ปี นำเกษตรอินทรีย์ดูแลชีวิตของสังคม สนับสนุนส่งเสริมให้มีการรวมตัวของเกษตรกรเพื่อลดต้นทุนการผลิต และใช้ทรัพยากรปัจจัยการผลิตร่วมกัน ลดหนี้ของเกษตรกรให้เป็นศูนย์ภายใน 4 ปี'),('พลังสังคม','198','IMG85','วิฑูรย์','ชลายนนาวิน','26-11-61','นโยบายแก้ไขปัญหาที่ดินทำกินของราษฎร ให้มีเอกสารสิทธิ์โดยชอบตามกฎหมาย ทุกครัวเรือนโดยปรับปรุงระเบียบและข้อกฎหมายที่เกี่ยวข้อง | นโยบายสหกรณ์พรรคพลังสังคมที่เกี่ยวกับเรื่องที่ดินทำกิน | แก้ไข ปรับปรุงกฎหมาย เครดิตบูโร โดยการผลักดันให้มิให้โดน Blacklist โดยลดเงื่อนไขลง 1 ล้านบาท มิให้เป็นหนี้ | ตั้งศูนย์รับเรื่องราวร้องทุกข์ ทั้ง 4 ภาค ในทุกเรื่องโดยเน้นที่ดินทำกิน'),('พลังแรงงานไทย','199','IMG86','พิเชษฐ์','ภูแก้ว','26-11-61','ยกเลิกกฎหมายหนี้สินที่ไม่เป็นธรรม | ให้ที่ทำกินครอบครัวละ 5 ไร่ | รักษาพยาบาลฟรี | เรียนฟรีชั้นอนุบาลถึงปริญญา | ยกเลิกหนี้สิน กยส. และ เครดิตบูโร | ยกระดับเกษตรกรและแรงงานสู่สากล'),('พลังไทสร้างชาติ','200','IMG87','ณภัคธร','ชัยสงคราม','26-11-61','แปลงวุฒิการศึกษาเป็นทุนทรัพย์ เป็นพรรคของเกษตรกร และคนฐานราก สร้างความเท่าเทียมทางสังคม 1 แพทย์ 1 โรงพยาบาลส่งเสริมสุขภาพตำบล สร้างตลาดทุน เพื่อเกษตรกร'),('พลังศรัทธา','201','IMG88','อนันตร์','บุญรำไพ','26-11-61','เรียนฟรีจนถึงมัธยมปลาย อาหารกลางวันฟรี รถไฟชั้น 3 ฟรี รถเมล์ฟรีเชื่อมโยงทุกภูมิภาค ที่ทำกินฟรี ออกเอกสารสิทธิเสมอภาคปุ๋ยชีวภาพฟรี รักษาพยาบาลฟรี มีครูสอนภาษาต่างประเทศให้นักเรียนและประชาชนฟรี จัดให้มีคลินิกให้คำปรึกษาปัญหาแก้จนฟรี ปลูกไม้ยืนต้นในที่ตนเองได้ทุกชนิดเป็นไม้เศรษฐกิจปลูกได้ตัดได้ ติดตั้งแผงโซล่าเซลฟรี พักหนี้เกษตรกร หนี้ กยศ. และหนี้ราชการ 4 ปี ให้บำนาญราชการตกทอดถึงลูกหลาน และคู่สมรส'),('พลังแผ่นดินทอง','202','IMG89','อนุวัฒน์','วิใจเงิน','03-12-61','นโยบายและยุทธศาสตร์พรรคพลังแผ่นดินทองการบริหารประเทศมั่งคง มั่งคั่ง และยั่งยืน ระยะ 4 ปี (พ.ศ.2562-2565) รวม 5 นโยบาย 73 แนวทางพัฒนา ดังนี้ นโยบายที่ 1 พัฒนาอาชีพรายได้ของประชาชนเพื่อคุณภาพชีวิตที่ดี นโยบายที่ 2 พัฒนาคนไทย 4.0 เพื่ออนาคตประเทศไทย นโยบายที่ 3 ลดความเหลื่อมล้ำ ความยากจนและจัดสวัสดิการเพื่อคนไทยอยู่ดีมีสุขทั่วหน้า นโยบายที่ 4 ยกระดับการพัฒนาภาคและพื้นที่เป้าหมายทางเศรษฐกิจเพื่อการแข่งขัน นโยบายที่ 5 พัฒนาสร้างอนาคตประเทศไทย'),('กลาง','203','IMG90','ชุมพล','ครุฑแก้ว','11-12-61','พรรคกลางนำเสนอเทคโนโลยีเพื่อประชาธิปไตย ด้วยประชาธิปไตยทางตรง อำนาจจะอยู่ในมือ(ถือ)ของประชาชนตลอดไป [ปชช.มีส่วนร่วมได้ในทุกการตัดสินใจและเป็นผู้ลงประชามติได้ปีละหลายครั้ง รวมถึงการเสนอนโยบายเองได้ด้วยปลายนิ้ว] เราไม่มีนายทุนชี้นำเบื้องหลัง เราเป็นจิตอาสาจากหลากหลายอาชีพ เสียสละเข้ามาร่วมงาน ก้าวข้ามความขัดแย้ง พัฒนาอย่างสร้างสรรค์ เน้นแก้ปัญหาอย่างยั่งยืน มุ่งสร้างความเที่ยงธรรมในสังคม และ ส่งเสริมการมีส่วนร่วม/รับฟัง/กระจายอำนาจ ส.ส.พรรคกลางจะทำงานต่อเนื่องช่วยเหลือ ปชช. ผ่านศูนย์ร้องเรียน ที่จะช่วยให้คำปรึกษาด้านกฎหมายด้วยเครือข่ายจิตอาสา ส.ส.พรรคกลางจะสอบถามความเห็นสมาชิก/ปชช. ก่อนเข้าไปอภิปราย/ออกเสียงในสภา “ปชช.ทุกคนเป็นนักการเมืองได้”'),('พลังเพื่อไทย','204','IMG91','เอกวรพงศ์','อำนวยทรัพย์','11-12-61','NULL'),('ประชาไทย','205','IMG92','บุญยงค์','จันทร์แสง','20-12-61','ก้าวข้ามความขัดแย้ง เชื่อมโยงใจ หลอมรวมไทยทั้งแผ่นดิน ความอยู่รอดประเทศไทยต้องมาก่อน หยุดอาฆาต | สหกรณ์แบ่งปันสร้างสรรค์วิถีไทย แผนพัฒนาอาชีพแห่งชาติตรงยุคสมัยคนไทยมีงานทำ 1 หมู่บ้าน 1 วิสาหกิจ | พลเมืองดีมีที่อยู่ที่ทำกิน ขจัดสิ้นคอร์รัปชัน ยาเสพติด ฟื้นฟูดูแลสิ่งแวดล้อม หยุดประชานิยม สอนคนให้ทำกิน | ลดเหลื่อมล้ำสร้างความเท่าเทียมในทุกด้านตั้งแต่ตั้งครรภ์จนถึงจากไปอย่างสงบอาชีวะจะสร้างชาติ เรียนฟรีมีเงินใช้ | อินเทอร์เน็ตทั่วทิศ กับชีวิตที่รอบรู้ โรงเรียนผู้สูงวัยใส่ใจความรู้ สุขกายสุขใจ เงินทองเหลือใช้ คลังความรู้สู่ชุมชน | ชีวิตปลอดภัย ใส่ใจสิ่งแวดล้อม พลังงานปลอดภัย สดใสสะอาด ใช้อย่างคุ้มค่า เทพบนฟ้าเทวดาบนดิน'),('กรีน','206','IMG93','พงศา','ชูแนม','20-12-61','ต้นไม้เป็นทรัพย์สิน : ออกกฎหมายรับรองต้นไม้ให้เป็นหลักทรัพย์โดยการออกบัตรคนรวย TAC ; tree asset card | ที่ทำกินถูกต้องเป็นธรรม : คือการออกมาตรการให้ที่ดินทำกินให้ชอบด้วยกฎหมายแก้ปัญหาคนในเขตป่า 17 ล้านคนด้วยแนวทางให้สิทธิสีเขียว right&green | เกษตรกรรมสุขภาพ : เพื่อคุ้มครองสิทธิเกษตรกรที่ผลิตอาหารสุขภาพให้มีความเท่าทัน ตามอุดมการณ์ ลดอำนาจรัฐ ตัดอำนาจทุน หนุนอำนาจประชาชน | สันติภาพยั่งยืน : การให้สภาประชาชนในโลกดิจิทัลตรวจสอบกำกับรัฐและทุน เช่นการใช้สมการราคากำกับสินค้าให้สัมพันธ์กับราคาพืชผล'),('พัฒนาประเทศไทย','207','IMG94','อติโรจ','บุญใย','20-12-61','ปลดหนี้กองทุนหมู่บ้าน โดยยกเลิกกองทุนหมู่บ้านไม่เก็บหนี้ที่สมาชิกค้างอยู่ | เพิ่มเงินผู้สูงอายุ (ปี) และคนพิการเป็น 3,600 บาท - 3,720 บาทต่อเดือน | โครงการเกษตรกรร่วมกับโรงสี ร่วมกันส่งออกรัฐบาลเป็นผู้หาตลาดและออร์เดอร์ | ลดราคาสินค้าอุปโภคบริโภคและสินค้าเพื่อการเกษตรทุกรายการโดยรัฐบาล จะลดภาษีให้ผู้ประกอบการ ผู้ประกอบการมีหน้าที่ลดราคาสินค้า | ยกเลิกโครงการ 30 บาท เป็นรักษาฟรี ไม่ต้องมีหนังสือส่งตัว ยาดี รักษาได้ทุกโรงพยาบาลของรัฐ'),('ฐานรากไทย','208','IMG95','ญาณวุฒิ','พรหมเดชากุล','25-12-61','การขจัดความยากจนของประชาชนผู้ยากไร้ ด้วยการสร้างงานจำนวนมาก นำมาออกแบบงานให้เกิดเป็นอาชีพต่างๆ ที่เป็นความจำเป็นพื้นฐานของประเทศ หรือเป็นงานที่ตลาดมีความต้องการ ทั้งตลาดเก่าและตลาดเกิดใหม่ เพื่อให้ประชาชนในแต่ละพื้นที่มีงานมีอาชีพอันเป็นพื้นฐานของรายได้ แทนการแจกเงินโดยตรง ขจัดอุปสรรคที่ทำให้ผู้ประกอบสัมมาอาชีวะด้วยความขยันขันแข็งพ้นจาก ความยากจน | กำจัดคนทุจริตทุกรูปแบบ ทั้งในราชการและเอกชนที่เอื้อต่อการผูกขาดตัดตอน เป็นการสมคบกันโกงประชาชน | การคุ้มครองประชาชนด้านการรักษาพยาบาลโรคร้ายแรง แทนการรักษาทุกโรคที่สิ้น'),('สามัญชน','209','IMG96','เลิศศักดิ์','คำคงศักดิ์','26-12-61','ลดความเหลื่อมล้ำสี่ด้าน คือ 1.ขจัดความเหลื่อมล้ำทางการเมือง โดยการ “กระจายอํานาจ ยกเลิกการบริหารจากสวนกลางสนับสนุนการปกครองส่วนท้องถิ่น สร้างพื้นที่ประชาชน ส่งเสริมเสรีภาพในการแสดงความคิดเห็น การเข้าถึงข้อมูลข่าวสารของภาครัฐ และสนับสนุนให้ประชาชนตัดสินอนาคตด้วยตนเอง”     2. ขจัดความเหลื่อมล้ำทางเศรษฐกิจและแรงงาน กระจายอำนาจการผลิต การประมงและการเกษตร ส่งเสริมการค้าที่เป็นธรรม ปกป้องพื้นที่ทำกิน และการจัดการที่ดินอย่างเป็นธรรม     3.ขจัดความเหลื่อมล้ำทางสังคม วัฒนธรรม และความรู้    4.ขจัดความเหลื่อมล้ำทางสิ่งแวดล้อม ผลักดันกฎหมายอากาศบริสุทธิ์ EIA และการตัดสินใจจากชุมชนต้องมาก่อน คำกล่าวอ้างที่เรียกว่า “การพัฒนาทางเศรษฐกิจ”'),('พลังครูไทย','210','IMG97','วิทธยา','บริบูรณ์ทรัพย์','02-01-62','ส่งเสริมและพัฒนาการศึกษาให้มีคุณภาพ บริการทั่วถึง หนึ่งครอบครัว หนึ่งปริญญาตรี | ส่งเสริมและพัฒนาด้านเศรษฐกิจ แรงงาน อุตสาหกรรม เกษตรกรรม คมนาคม ที่ดินทำกินให้ประชาชนอยู่ดีกินดี | จัดสวัสดิการให้ประชาชนดำรงชีพได้อย่างมีความสุข ดูแลผู้สูงอายุ และคนพิการเป็นพิเศษ | จัดให้มีบริการด้านสาธารณสุขให้กับประชาชนเท่าเทียมและทั่วถึง | ส่งเสริมการพัฒนาชุมชนในด้านสาธารณูปโภค ให้ประชาชนมีคุณภาพชีวิตที่ดีขึ้น | จัดบริการด้านเทคโนโลยีสารสนเทศทั่วถึง โดยไม่มีค่าใช้จ่าย | ปรับปรุงแก้ไขกฎหมายที่ไม่เป็นธรรมโดยเฉพาะอย่างยิ่งกฎหมายการศึกษา'),('ภาคีเครือข่ายไทย','211','IMG98','กฤษอนงค์','สุวรรณวงศ์','02-01-62','พลังเครือข่ายอาชีพ เพราะทุกอาชีพคือการสร้างสัมพันธ์เครือข่ายของตนให้เป็นหนึ่งเดียวและเป็นการรวมกำลัง เพื่อสร้างสรรค์และแก้ไข เพื่อพัฒนาในสิ่งที่อาชีพตนเองต้องการอย่างตรงเป้า ทำทั้งระบบ | มรดกพ่อ คือการสืบสานโครงการพ่อ ทำในสิ่งที่มีอยู่แล้ว และพัฒนาต่อให้ดียิ่งๆขึ้นไป พัฒนาและยกระดับการทำเกษตรกรรมและคุณภาพชีวิตเกษตรกรไทย เชื่อมวงจรให้เกิดประสิทธิภาพ และประโยชน์สูงสุดทุกฝ่าย | นวัตกรรมออนไลน์ไซเบอร์ มันไม่ใช่สิ่งใหม่ แต่มันคือ ส่วนหนึ่งในชีวิตของคนในแต่ละยุคนั้นๆ ดังนั้นเพื่อการอยู่อย่างเท่าทันปัจจุบัน ไม่ตกยุค'),('พลังไทยดี','212','IMG99','สาธุ','อนุโมทามิ','02-01-62','สร้างการปกครองแบบประชาธิปไตยที่เหมาะสมกับสภาพของประเทศชาติ | ปฏิวัติระบบสาธารณสุขไทย ทำให้คนไทยสุขภาพดี แข็งแรง ไม่เจ็บป่วยด้วย สสปช. | นโยบาย สปก. แผ่นดินทองคำ | ปฏิวัติการศึกษาชาติ ด้วยการศึกษานอกระบบด้วยนวัตกรรมออนไลน์ | อาสาสมัครประชาชนทุกคนมีรายได้ | วิถีชีวิต วิถีธรรม ยกระดับความสุขประชาชน | กองทุนพัฒนาชีวิตใหม่ ให้โอกาสคนไทยเข้าถึงแหล่งทุนทุกระดับ | แก้ปัญหาหนี้สิน กยศ. ด้วยการทำความดี ปลดหนี้ได้'),('เพื่อไทยพัฒนา','213','IMG100','อรอนงค์','บุญโต','02-01-62','เพิ่มรายได้ กระจายโอกาส ชาติมั่นคง เพิ่มรายได้ หนึ่งหมู่บ้าน หนึ่งเศรษฐกิจ หนึ่งตำบล หนึ่งแพทย์แผนไทย ส่งเสริมเศรษฐกิจชุมชนให้เข้มแข็ง เพิ่มทุน เพิ่มตลาด เพิ่มโอกาสการแข่งขัน ประกันราคาพืชผล ส่งเสริมเกษตรอินทรีย์ หนึ่งอำเภอ หนึ่งตลาดการเกษตร กระจายโอกาส กระจายการลงทุนและกระจายกิจกรรมระดับประเทศไปยังกลุ่มจังหวัด ชาติมั่นคง สร้างสังคมแห่งความสมานฉันท์และการเรียนรู้'),('พัฒนาชาติ','214','IMG101','ชนาธิป','ตามสมัย','23-01-62','NULL'),('คนงานไทย','215','IMG102','ธีระ','เจียบุญหยก','29-01-62','พรรคคนงานไทยเป็นพรรคที่ก่อตั้งขึ้นโดยกลุ่มคนที่จงรักภักดีต่อชาติ ศาสนา พระมหากษัตริย์ รัฐธรรมนูญเป็นทางเลือกใหม่แห่งความหวังของประชาชนชาวไทยทุกระดับ สร้างสรรค์การศึกษาสู่ประชาชาติ ไม่เป็นทาสสิ่งเสพติด พรรคคนงานไทยจะช่วยเหลือเกษตรกรให้มีพื้นที่เกษตรกรรมเป็นของตนเอง ปรับปรุงพื้นที่ทิ้งร้าง ผลักดันเกษตรแปรรูป ส่งเสริมการส่งออกสินค้าภาคเกษตรกรรม พรรคคนงานไทย จัดการแก้ไขปัญหาเรื่องแรงงานต่างด้าว ปราบปรามการค้ามนุษย์ พรรคคนงานไทย ต่อต้านการคอรัปชั่น มุ่งมั่นและปราบปรามการทุจริตทุกรูปแบบ');
